import {FC, useEffect} from "react";
import {ProductCard} from "../../ui";
import {useSelector} from "react-redux";
import { connect } from "react-redux";
import {compose} from 'redux'
import {AppStateType} from "../../Redux/reducer";
import {actionAllProducts} from '../../Redux/Products/actions'

type PropsType = {
    changeActionProducts:[]
}
const Transport:FC<PropsType> = ()=> {

    const Products = useSelector((state) => state);


    return(
        <div className='batman-store__container'>
            <ProductCard/>

        </div>
    )

}
type MapPropsType = ReturnType<typeof mapStateToProps>
const mapStateToProps = (state:AppStateType) => {

    return { ...state };
};

const mapDisptchToProps = {
    changeActionProducts: () => ({ type: 'GET_PRODUCTS' }),
};
type DispatchPropsType = {
    actionAllProducts: () => void
}
let AppContainer = compose<React.ComponentType>(
    connect(mapStateToProps, {actionAllProducts}))(Transport)
export default Transport;
